`
const Right = styled.div`

`
const Wrapper = styled.div`
  margin: 10px 10%;
  width: 80%;
  background-color: #fff;
  display: flex;
`;
const Title = styled.p`
  margin: 20px 40px;
  font-size: 25px;
  font-weight: 600;
`;

const BookList = () => {
  return (
    <Container>
      <Right></Right>
      <Wrapper>
        <Title>Books</Title>
      </Wrapper>
      <Wrapper>
        <Books />
      </Wrapper>
    </Container>
  );
};

export default BookList;
